import React from "react";
import './photoHouse.css'

export const PhotoHouse = (props) =>{
    return(
        <div className='container'>
            <div className='block-photo'>
                <ul key={props.id}>
                    <img src={props.img} alt=''/>
                </ul>
            </div>
        </div>
    )
}
